import React from 'react'
import axios from 'axios'
import { useState } from 'react'

function LoginPage() {

  const [quote, setQuote] = useState('')

  const getQuote = () => {
    axios.get("/login")
    .then(
      response => {
        // response has these props: data, status, statusText, and a few more but the first 3 are key
        setQuote(response.data)
        }
    ).catch(error => {
      console.log(error)
    })
  }


  return (
    <div>
      {/* <h1>LOGIN</h1> */}
      <button onClick={getQuote}>Get Quote</button>
      {!quote ? <p>No quote to be displayed</p> : <p>{quote}</p>}
      {/* next step is to figure out how to set up server and send + receive requests */}
      {/* start with some dummy requests and then move on to trying spotify */}
    </div>
  )
}

export default LoginPage
